$_MODULE['<{appagebuilder}prestashop>guide_55c3c7f89c0bd6d1cc0bcbb0246cbd4e'] = 'Crea nuovo profilo';
$_MODULE['<{appagebuilder}prestashop>guide_a27ed6a695aa474957c9a650f9b86904'] = 'È possibile creare più profili, un solo profilo, il valore predefinito sarà attivato quando il sito è pubblicato. Ogni profilo è possibile personalizzare l\'interfaccia di modificare indipendentemente l\'uno dall\'altro sito, JavaScript e il codice CSS per modificare direttamente qui dovrebbe diventare più flessibile.';
$_MODULE['<{appagebuilder}prestashop>guide_54cb3772ee4512ae0d6f85f846b3a7c7'] = 'Come creare una nuova schermata del profilo: Dal menu a sinistra \"Ap Gestisci profili\" alla schermata successiva liste Profilo; Fare clic sul pulsante \"Aggiungi nuovo +\"';
$_MODULE['<{appagebuilder}prestashop>guide_0b7ccbc45a27df932564e298a1517fe6'] = 'Aggiungere nuovi widget e moduli per costruire siti Web in un profilo.';
$_MODULE['<{appagebuilder}prestashop>guide_1339273fae8c281aebfa708f299d4854'] = 'Questo modulo fornisce anche molti widget per costruire funzioni di vendita, flessibilità di interfaccia utente intuitiva. integrare anche i moduli esistenti in questo modulo, avete solo bisogno di costruire un sito costruito proprio qui e diventare la pagina più veloce.';
$_MODULE['<{appagebuilder}prestashop>guide_47a7f937550e2076b96d3043911dd967'] = 'Come creare una nuova schermata del profilo: Dal menu a sinistra \"Ap Gestisci profili\" alla schermata successiva liste Profilo; fare clic sul pulsante \"Visualizza\" nella lista dei profili.';
